import React from 'react';

import Navbar from '../components-custom/Navbar';
import HeroBanner from '../components-custom/HeroBanner';
import CallToAction from '../components-custom/CallToAction';
import Why from '../components-custom/Why';
import StructureContainer from '../components-structure/__structures/StructureContainer';
import Footer from '../components-custom/Footer';

export default function Index() {
  return (
    <React.Fragment>
      <Navbar />

      <HeroBanner />

      <CallToAction />

      <Why />

      <StructureContainer bucket1={[<Footer />]} />
    </React.Fragment>
  );
}
